    "from tensorflow.keras.preprocessing.image import ImageDataGenerator#generate label\n",
    "from tensorflow.keras.preprocessing import image\n",
    "from tensorflow.keras.optimizers import RMSprop\n",
    "import matplotlib.pyplot as plt\n",
    "import tensorflow as tf\n",
    "import numpy as np\n",
    "import cv2\n",
    "import os\n",
    "img=image.load_img(\"C:\\\\Users\\\\Rithu\\\\OneDrive\\\\Desktop\\\\computer vision\\\\base data\\\\training\\\\dog\\\\dog_80.jpg\")\n",
    "plt.imshow(img)\n",
    "cv2.imread(\"C:\\\\Users\\\\Rithu\\\\OneDrive\\\\Desktop\\\\computer vision\\\\base data\\\\training\\\\dog\\\\dog_80.jpg\").shape\n",
    "train=ImageDataGenerator(rescale=1/255)\n",
    "validate=ImageDataGenerator(rescale=1/255)\n",
    "train_dataset=train.flow_from_directory(\"C:\\\\Users\\\\Rithu\\\\OneDrive\\\\Desktop\\\\computer vision\\\\base data\\\\training\",\n",
    "                                       target_size=(200,200),\n",
    "                                       batch_size=3,\n",
    "                                       class_mode=\"binary\")\n",
    "validation_dataset=validate.flow_from_directory(\"C:\\\\Users\\\\Rithu\\\\OneDrive\\\\Desktop\\\\computer vision\\\\base data\\\\validation\",\n",
    "                                       target_size=(200,200),\n",
    "                                       batch_size=3,\n",
    "                                       class_mode=\"binary\")\n",
    "train_dataset.class_indices\n",
    "train_dataset.classes\n",
    "model=tf.keras.models.Sequential([tf.keras.layers.Conv2D(16,(3,3),activation=\"relu\",input_shape=(200,200,3)),\n",
    "                                                        tf.keras.layers.MaxPool2D(2,2),\n",
    "                                                         \n",
    "                                tf.keras.layers.Conv2D(32,(3,3),activation=\"relu\"),\n",
    "                                                        tf.keras.layers.MaxPool2D(2,2),\n",
    "                                                       \n",
    "                                tf.keras.layers.Conv2D(64,(3,3),activation=\"relu\"),\n",
    "                                                        tf.keras.layers.MaxPool2D(2,2),\n",
    "                                tf.keras.layers.Flatten(),\n",
    "                                 \n",
    "                                tf.keras.layers.Dense(512,activation=\"relu\"),\n",
    "                                 \n",
    "                                                         \n",
    "                                tf.keras.layers.Dense(1,activation=\"sigmoid\")#binary\n",
    "                                 ])\n",
    "model.compile(loss=\"binary_crossentropy\",\n",
    "             optimizer=RMSprop(learning_rate=0.001),\n",
    "             metrics=[\"accuracy\"])\n",
    "from tensorflow.keras.callbacks import EarlyStopping\n",
    "early_stopping = EarlyStopping(monitor='val_loss', patience=10, restore_best_weights=True)\n",
    "model_fit=model.fit(train_dataset,\n",
    "    steps_per_epoch=3,  \n",
    "    epochs=50,\n",
    "    validation_data=validation_dataset,\n",
    "    callbacks=[early_stopping])\n",
    "dir_path=\"C:\\\\Users\\\\Rithu\\\\OneDrive\\\\Desktop\\\\computer vision\\\\base data\\\\testing\"\n",
    "for i in os.listdir(dir_path):\n",
    "    img=image.load_img(dir_path+'//'+i,target_size=(200,200))\n",
    "    plt.imshow(img)\n",
    "    plt.show()\n",
    "    x=image.img_to_array(img)\n",
    "    x=np.expand_dims(x,axis=0)\n",
    "    images=np.vstack([x])\n",
    "    val=model.predict(images)\n",
    "    if val==0:\n",
    "        print(\"cat\")\n",
    "    elif(val==1):\n",
    "        print(\"dog\")\n",
    "\n"
